    "annotation":"Česká rocková hudební skupina Precedens vznikla v roce 1982. Vedoucím a autorem hudby je Martin Němec. Výraznou postavou této skupiny se stala Bára Basiková. Za mikrofonem jí také zastoupili zpěváci Vladimír Dvořák, Jana Benetová nebo Petr Kolář.\n\nLegendární kapela Precedens právě přichází ve výrazně omlazené sestavě špičkových hudebníků s ambiciózním koncertním projektem, kterému vévodí fenomenální hlas hradecké rodačky Ivy Marešové. Na koncertě zazní původní skladby i novinky v energickém a jedinečném podání. Uslyšíte tak nezapomenutelné hity jako Souměrná, Eloise nebo Soumrak bohů.\nObsazení:\nIva Marešová - zpěv\nJan Šobr - kytara\nMartin Němec - klávesy\nMartin Ivan - basová kytara\nPavel Nedoma - klávesy\nRadek Doležal - bicí\nKontakt: www.butterfly-agency.cz, www.butterfly-aid.cz\n\nCena: 340 Kč",
