    "name":"Food festival Zábřeh",
    "from":1463256000000,
    "to":1463284800000,
    "insertedById":null,
    "language":"en",
    "description":"Festival se bude konat za účasti profesionálních i amatérských ,,kuchtíků\", kteří vám připraví to nejlepší ze street foodu (palačinky, grilované sýry, hamburgery, reuben, paella, sushi, veganské polévky, raw strava...). Vedle této nabídky se můžete těšit i na zahraniční kuchyni: japonskou, španělskou, řeckou, italskou, gruzínskou, vietnamskou, mexickou.... Kromě chutného jídla plánujeme i doprovodný program. Dětský koutek, kde si například děti budou moci usmažit vlastní skvělé palačinky nebo udělat domácí čokoládu.\nSoučástí budou i přednášky o zdravé stravě a workshopy s ukázkami vaření specialit mezinárodní kuchyně.\nAtmosféru celého dne doprovodí hudební program.\nZažijte město jinak. Přijďte ochutnat kvalitní jídlo, které se bude připravovat přímo na ulici.\nTěšit se můžete na „profesionály“, kteří budou vařit přímo před zraky návštěvníků, ale i sousedy, kteří ukuchtí své vlastní dobroty.\nNebude chybět ani studená kuchyně - sirupy, sýry, čokoláda, francouzské víno, marmelády nebo domácí zavařeniny.\nVšechny účastníky budeme postupně zveřejňovat.\nTěšíme se na vás.",
    "annotation":"Co se takhle v Zábřehu dobře najíst? Čerstvě, kvalitně, z lokálních surovin a poctivě? Ochutnat speciality mezinárodní kuhyně, lokální dobroty nebo se podívat na gastroshow výborných kuchařů - a u toho se hlavně dobře bavit! To vše nabízí street food festival, který připravujeme v Zábřehu v sobotu 14. května na ulici Farní a v prostoru pod zámkem - u Kapří fontánky...",
